 (props: {
  filter?: (item: AugmentedAnyModelType) => boolean;
  modelName?: string;
}) => {
  const router = useRouter();
  const { modelName, filter } = props;
  const paths = router.query.paths ? makeArray(router.query.paths) : [];
  const modelQuery = modelName || paths.pop();
  const [slug] = useUrl("slug");
  const [id] = useUrl("id");

  return (
    <Div scroll>
      <ModelComponent modelName={modelQuery} highlight={{ slug, id }} />
    </Div>
  );
}
